Sick of her marriage, bored with her life and tired of sex, Sally realizes she's on a dead end run.  So does Sally's husband who in a last ditch effort to rekindle an old flame, confines Sally to their bed and forces her to watch porn after porn after porn...  And to Sally's amazement, she finds herself increasingly drawn into this world of perfect bodies and beautiful people!  How far will Sally's renewed appetites  take her and will she ever want to stop?

